request.description:
### Get Beacon Data

This endpoint retrieves beacon data for a specific project and language.

#### Request Parameters

- `projectCode` (query parameter) - The code for the project.

- `language` (query parameter) - The language for which beacon data is requested.


#### Response

The response for this request is in JSON format and contains the schema for the beacon data.

Example Response Schema:

``` json
{
  "type": "object",
  "properties": {
    "beaconId": {
      "type": "string"
    },
    "location": {
      "type": "string"
    },
    "status": {
      "type": "string"
    },
    "createdAt": {
      "type": "string",
      "format": "date-time"
    }
  }
}

 ```

